  false,\n\t\"url\": null,\n\t\"notes\": \"Restoring aquatic health of Malheur Lake
  is a priority goal of the CCP. Introduction of common carp to the Silvies River
  watershed has resulted in a long-term decrease of aquatic health and, in turn, wildlife
  utilization of Malheur Lake as indicated by the dramatic decrease in coverage of
  submergent aquatic vegetation communities. Waterfowl use the lake extensively, and
  numbers have declined over time. Northern shoveler and canvasback are focal species
  for lake habitats in the CCP. The lakes can only be adequately surveyed for waterfowl
  from the air. This survey would track trend in waterfowl use of the lakes, and evaluate
  the effectiveness of carp control resulting in increased use of the lakes by waterfowl.\",\n\t\"license_title\":
